			$global:MFTfile = $openfiledialog1.FileName
			$fs = [io.FileInfo]::new("$global:MFTfile").Length
			[int]$ceiling = [math]::Ceiling($fs/1024) - 1
			$richtextbox1.Text = $null
			$datagridview1.Rows.Clear()
			$toolstripSearchFilename.Items.Clear()
			$toolstripSearchMFTNr.Items.Clear()
			$treeview1.Nodes.Clear()
			$MFTrange = $null
			[GC]::Collect()
			$Status.Text = $null
			$MFTRecordViewer.Text = "`$MFT Record Viewer - $($global:MFTfile)"
			if ((Show-Options_psf -MFTfile $global:MFTfile) -eq 'OK')
			{
				if (!!$script:MFTrange -and $script:MFTrange.count -gt 1)
				{
					$count = $script:MFTrange.count
					$min = [int]($script:MFTrange | Measure -Min).Minimum
					$max = [int]($script:MFTrange | Measure -Max).Maximum
				}
				else{ $count = $script:MFTrange.count}
				#######
				# load single valid records
				if ($count -eq 1 -and [Int]$script:MFTrange -in (0 .. $ceiling))
				{
					$MFTrange = [Int]$script:MFTrange
					Load-MFT -MFTfile $global:MFTfile -MFTrecord $MFTrange
				}
				elseif ([int]$max -le $ceiling -and $count -gt 1)
				{
					$MFTrange = $min .. $max #$script:MFTrange
					Load-MFT -MFTfile $global:MFTfile -MFTrecord $MFTrange
				}
				elseif ([int]$max -gt $ceiling) { [System.Console]::Beep(500, 150); Return }
				# if blank load all the records
				elseif ($script:MFTrange -eq "")
					{
						Load-MFT -MFTfile $global:MFTfile
					}
				else { Load-MFT -MFTfile $global:MFTfile -MFTrecord $script:MFTrange }
				#######
				$Status.Text = "Ready"
				$NewRange.Enabled = $true
			}
			
		}
		else
		{
			$MFTRecordViewer.Text = "`$MFT Record Viewer"
		}
	} #end Open_Click
	
	
	$datagridview1_CellMouseEnter=[System.Windows.Forms.DataGridViewCellEventHandler]{
