	$toolstripSearchMFTNr_KeyPress=[System.Windows.Forms.KeyPressEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.KeyPressEventArgs]
		$_.Handled = ![char]::IsNumber($_.KeyChar) -and ![char]::IsControl($_.KeyChar)
	}#end toolstripSearchMFTNr_KeyPress
	
	$toolstripSearchFilename_KeyPress=[System.Windows.Forms.KeyPressEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.KeyPressEventArgs]
		$_.Handled = ![Char]::IsLetterOrDigit($_.KeyChar) -and ![char]::IsControl($_.KeyChar)
	}#end toolstripSearchFilename_KeyPress
	
	
	$Cancel_Click={
		$script:cancelreading = $true
	}#end Cancel_Click
	
	$treeview1_BeforeSelect=[System.Windows.Forms.TreeViewCancelEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.TreeViewCancelEventArgs]
		if ($_.Action -eq 'ByMouse')
		{
			if ($_.Node.Parent.Name -eq "MFT")
			{
				$treeview1.BeginUpdate()
				foreach ($node in $_.Node.Parent.Nodes)
				{
					if ($node -ne $_.Node)
					{
						$node.Collapse()
					}
				}
			}
			
		}
		$treeview1.EndUpdate()
	} #end treeview1_BeforeSelect
	
	
